                    <h3 className = "label">Arrow Values</h3>
                </div>
                <div className = "end-score-container span-two">
                    <h3 className = "label">End Score</h3>
                </div>
                <div className = "total-score-container span-two">
                <h3 className = "label">Total Score</h3>
                </div>
            </div>
        </>
    )
}

